  \ as \"ContractSignedDate\",\n       \"DV_U_HI_INSTANCE\" as \"HIInstanceValue\"\
  ,\n       \"U_INSTANCE_ID\" as \"Instance\",\n       \"U_CONTRACT_REVIEWED\" as\
  \ \"ContractReviewed\",\n       \"U_CONTRACT_NUMBER\" as \"Contractnumber\",\n \
  \      \"U_AR_NOTES\" as \"ARNotes\",\n       \"U_HI_INSTANCE\" as \"HIInstanceID\"\
  \nFROM \"RDS\".\"SURF\".\"U_FINANCE_SALES_JOIN\";"
